import { Link } from 'react-router-dom';

function navbar() {
    return (
   <>
   <nav classname="navbar">
       <div classname="navbar-container">
           <Link to="/" classname="navbar-logo"> 
           HELLO <i className='fab fa-typo3' />
           </Link>

       </div>
   </nav>
   </>
    )
}

export default navbar
